import React from "react";

function Login({ submitButton }) {

  const [email, setEmail] = React.useState('');
  const [password, setPassword] = React.useState('');

  function handleSubmit(e) {
    e.preventDefault();
    if (!email || !password) {
      return;
    }
    setEmail('');
    setPassword('');
    submitButton(email, password);
  }

  function handleSubmitEmail(e) {
    setEmail(e.target.value);
  }

  function handleSubmitPassword(e) {
    setPassword(e.target.value);
  }

  return (
    <div className="start">
      <h1 className="start__title">Вход</h1>
      <form className="start__form" name="form" noValidate onSubmit={handleSubmit}>
        <input id="" className="start__input" type="email" placeholder="Email" required onChange={handleSubmitEmail} />
